---
import type { Options as Props } from "../../../types/forms";

const { options = [], selected } = Astro.props;
---

{
	options.map(({ label, options, value }) =>
		options ? (
			<optgroup label={label}>
				<Astro.self options={options} selected={selected} />
			</optgroup>
		) : (
			<option value={value} selected={selected === value}>
				{label}
			</option>
		)
	)
}
